import React from "react";
import Navbar from "react-bootstrap/Navbar"

function Nav() {
  return (
    <Navbar>
      <Nav.Link href="#link">Link</Nav.Link>
      <Nav.Link href="#link">Link</Nav.Link>
      <Navbar.Brand href="#home"></Navbar.Brand>
    </Navbar>
  );
}

export default Nav;
